Plot:

Tsurisaki Kiyotaka, the infamous Japanese death photographer and director of Orozco the Embalmer picks up his video camera and heads into the depths of Hell yet again. Junk Films is a collection of short shockumentaries filmed between the late 1990s and early 2000 s, with footage including everything from disemboweled auto accident victims in Krung Thep, to the self mutilating participants of the Vegetarian Festival in Phuket, and even footage of festering corpses in a Bogota landfill...       


